import React, { useEffect } from 'react';
import "./header.css"
import $ from 'jquery';

function loadScript(src) {
    return new Promise((resolve, reject) => {
        const script = document.createElement('script');
        script.src = src;
        script.onload = resolve;
        script.onerror = reject;
        document.body.appendChild(script);
    });
}

function Header() {
    useEffect(() => {
        const loadScripts = async () => {
            try {
                await loadScript('https://ajax.googleapis.com/ajax/libs/jquery/3.5.1/jquery.min.js');
                await loadScript('https://cubism.live2d.com/sdk-web/cubismcore/live2dcubismcore.min.js');
                await loadScript('../../components/live2dWigit/frame/pixi.min.js');
                await loadScript('../../components/live2dWigit/live2dcubismframework.js');
                await loadScript('../../components/live2dWigit/live2dcubismpixi.js');
                await loadScript('../../components/live2dWigit/l2d.js');
                await loadScript('../../components/live2dWigit/main.js');

                const config = {
                    right: '0px',
                    bottom: '0px',
                    width: 350,
                    height: 350,
                    basePath: '/static/live2d/Resources',
                    role: 'Domino',
                    opacity: 1,
                    mobile: false
                };
                var v = new Viewer(config);

                $(document).ready(function() {
                    headerShadow();
                });
            } catch (error) {
                console.error("Error loading scripts", error);
            }
        };

        const headerShadow = () => {
            var header = $('header');

            $(window).scroll(function(){
                if(header.offset().top > 0){
                    if(!header.hasClass('shadow')){
                        header.addClass('shadow');
                    }
                }else{
                    header.removeClass('shadow');
                }
            });
        }

        loadScripts();
    }, []);

    return (
        <div className="header">
            <meta charSet="UTF-8" />
            <meta name="viewport" content="width=device-width, initial-scale=1.0" />
            <link href='https://fonts.googleapis.com/css?family=Open Sans' rel='stylesheet' />
            <link rel="icon" href="/static/images/BinLTools_logo.ico" type="image/x-icon" />
            <link rel="preconnect" href="https://fonts.googleapis.com" />
            <link rel="preconnect" href="https://fonts.gstatic.com" crossOrigin="true" />
            <link href="https://fonts.googleapis.com/css2?family=Montserrat:wght@100;400&display=swap" rel="stylesheet" />
            <link href="https://fonts.googleapis.com/css2?family=Montserrat:wght@100;400;700&display=swap" rel="stylesheet" />
            <link href="https://fonts.googleapis.com/css2?family=Montserrat:wght@100;400;500;700&display=swap" rel="stylesheet" />
            <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/5.15.3/css/all.min.css" />
            <link rel="stylesheet" herf="style.css" />
            <link rel="stylesheet" href="/static/css/live2d.css" />

            <header>
                <div className="container">
                    <div id="branding">
                        <h1><a id="header_logo" href="/"><span className="highlight">BinL</span>Tools</a></h1>
                    </div>
                    <nav>
                        <ul>
                            <li><a href="/about_me">About Me</a></li>
                            <li><a href="https://github.com/BinL233">GitHub</a></li>
                            {/* TODO: Need to link to backend */}
                            <li><a href="/login"></a></li>
                        </ul>
                    </nav>
                </div>
            </header>
            <div>
                <div className="l2d"  id="L2d" >
                    <div id="L2dCanvas" className="Canvas"></div>
                </div>
            </div>
        </div>
    )
}

export default Header;
